/* 
A + B = C, A * B = C, only the C is thought to be denormalized.
*/

eval(eq(An/Ad,'*',Bn/Bd,'=',Cout),Cf) :-
	norm(Cn/Cd, Cout, Cf),
	Cd #= Ad * Bd,
	Cn #= An * Bn.

eval(eq(An/Ad,'+',Bn/Bd,'=',Cout),Cf) :-
	norm(Cn/Cd, Cout, Cf),
	An2 #= An * Bd,
	Bn2 #= Bn * Ad,
	Cn #= An2 + Bn2,
	Cd #= Ad * Bd.

norm(An/Ad, NormN/NormD, Af) :-
	An = Af * NormN,
	Ad = Af * NormD,
	Af #> 0,
	sky(Af).


